import React from "react";
import List from "./List";

function Data() {
  let dataArray = [
    {
      id: 1,
      imgae: './images/1.jpg',
      name: "islamabad best Place Tour Of 7 Days",
      price: "$ 500",
      para: 'this is list',
    },

    {
        id: 2,
        imgae: './images/2.jpg',
        name: "Peshawar best Place Tour Of 7 Days",
        price: "$ 300",
        para: 'this is list',
      },
      
      {
        id: 3,
        imgae: './images/3.jpg',
        name: "Karachi best Place Tour Of 7 Days",
        price: "$ 600",
        para: 'this is list',
      },

      {
        id: 4,
        imgae: './images/4.jpg',
        name: "Queeta best Place Tour Of 7 Days",
        price: "$ 500",
        para: 'this is list',
      },

      {
        id: 5,
        imgae: './images/5.jpg',
        name: "Lahore best Place Tour Of 7 Days",
        price: "$ 800",
        para: 'this is list',
      },

      {
        id: 6,
        imgae: './images/6.jpg',
        name: "Multan best Place Tour Of 7 Days",
        price: "$ 500",
        para: 'this is list ',
      }
  ];

  return (
  <div>
    <List data={dataArray}/>
  </div>
  );
}

export default Data;
